syntax = "proto3";

package cict.service_mail.v1;

option cc_enable_arenas = true;
option go_package = "github.com/cictapis/cict-auth/cict/service_mail/v1;service_mail";
option java_multiple_files = false;
option java_outer_classname = "EnumBuiltInTemplateProto";
option java_package = "com.github.cictapis.cict_reporter.cict.servicefileuploader.v1";

// Developer use built in template in code.
message EnumBuiltInTemplate {
  enum BuiltInTemplate {
    UNSPECIFIED = 0;
  }
}
